          <Card key={card} index={index} onRemove={removeCard} />
          
        ))};
      </div> */}
      <div>
      {Array.from({ length: 6 }).map((_, i) => (
        <Card key={i} />
      ))}
    </div>
      
      <Content />
    </div>
  );
};

